import React from 'react';
import { CalltoAction } from './slices';

const SliceZone = ({ sliceZone }) => (
    sliceZone.map((slice, index) => {
      switch (slice.slice_type) {
        case ('call_to_action'):
          return <CalltoAction slice={slice} key={`slice-${index}`} />;
        default:
          return null;
      }
    })
  );

  export default SliceZone;
